import React from "react";
import "./ReviewComponent.css";

export default function ReviewComponent({ review }) {
  return (
    <a href="">
      <div className="reviewBox">
        <div className="reviewHeader">
          <div className="userID">
            <img
              src={review.userImage}
              alt="userImage"
              style={{ width: "20px", height: "20px", borderRadius: "100%" }}
            />
            <div style={{ paddingLeft: "8px", fontSize: "12px" }}>
              {review.owner}
            </div>
          </div>
          <div className="grayText">{review.livingTime}</div>
        </div>
        <div className="reviewContent">
          <img
            src={review.objectImage}
            alt="objectImage"
            style={{ width: "120px", height: "80px" }}
          />
          <div className="reviewText">
            <div
              style={{
                display: "flex",
                alignItems: "flex-start",
                justifyContent: "space-between",
              }}
            >
              <span
                style={{
                  fontSize: "12px",
                  fontWeight: "bold",
                }}
              >
                상세 리뷰
              </span>
              <div style={{ fontSize: "8px" }}>
                <span style={{ color: "#fff100" }}>★</span>
                <span>{review.grade}</span>
              </div>
            </div>
            <div
              style={{
                width: "85%",
                marginTop: "4px",
                height: "50px",
                overflow: "hidden",
              }}
            >
              <div style={{ fontSize: "4px" }}>{review.reviewComment}</div>
            </div>
            <div style={{ width: "100%", textAlign: "end" }}>
              <span className="grayText">{review.createdAt}</span>
            </div>
          </div>
        </div>
      </div>
    </a>
  );
}
